import React, { useState } from "react";
import Carousel from "react-bootstrap/Carousel";
import Image from "react-bootstrap/Image";
import axios from "axios";
import { useEffect } from "react";
import { useDispatch, useSelector } from "react-redux";
import Loader from "../Components/loader";
import { chLoader } from "../store/action/loaderAction";

export default function HomePage() {
  const loader = useSelector((state) => state.loader.onLoad);
  const [products, setProduct] = useState([]);
  const dispatch = useDispatch();
  useEffect(() => {
    axios
      .get("https://dummyjson.com/products?limit=5")
      .then((res) => {
        setTimeout(() => {
          dispatch(chLoader(false));
        }, 2000);
        setProduct(res.data.products);
      })
      .catch((rej) => {
        console.log("err");
      });
  }, []);

  return (
    <>
      <Carousel>
        <Carousel.Item>
          <Image
            src="https://about.att.com/ecms/dam/snr/2022/september2022/storylevelbanner/iconic_STORY_LEVEL_BANNER_1600x483.jpg"
            fluid
          />
        </Carousel.Item>
        <Carousel.Item>
          <Image src="https://i.imgur.com/dwc6PQV.jpg" fluid />;
        </Carousel.Item>
        <Carousel.Item>
          <Image src="https://i.imgur.com/KO6T9w4.jpg" fluid />;
        </Carousel.Item>
      </Carousel>
      {loader ? (
        <>
          <div className="d-flex justify-content-center align-items-center vh-100">
            <Loader />
          </div>
        </>
      ) : (
        <>
          <div className="d-flex container gap-3">
            <div className="pt-3 d-flex container justify-content-center gap-3 flex-wrap">
              <div className="container justify-content-center d-flex gap-3">
                <BtnsCo btnText="Filter" btnCo="warning" btnAct={handleShow} />
                <SearchBar changeVal={getVal} />
                <BtnsCo
                  btnText="Search"
                  btnCo="primary"
                  btnAct={handleSearch}
                />
                <Offcanvas show={show} onHide={handleClose}>
                  <Offcanvas.Header closeButton>
                    <Offcanvas.Title>Categories</Offcanvas.Title>
                  </Offcanvas.Header>
                  <Offcanvas.Body>
                    <div
                      className="d-flex flex-column gap-2"
                      style={{ width: "auto" }}
                    >
                      {cate.map((category) => (
                        <div key={category}>
                          <Link
                            onClick={handleClick}
                            to={`/nameC/${category}`}
                            className="link-1"
                          >
                            {category}
                          </Link>
                        </div>
                      ))}
                    </div>
                  </Offcanvas.Body>
                </Offcanvas>
              </div>
              {currentProducts.map((product) => (
                <Card key={product.id} style={{ width: "20rem" }}>
                  <Card.Img
                    style={{ width: "100%", height: "180px" }}
                    variant="top"
                    src={product.images[1]}
                  />
                  <Card.Body>
                    <Card.Title>{product.title}</Card.Title>
                    <Card.Text>{product.description}</Card.Text>
                  </Card.Body>
                  <div className="d-flex gap-3 p-3 flex-column">

                    <Link
                      to={`/prods/${product.id}`}
                      onClick={handleClick}
                      className="link-1"
                    >
                      <p>View Details</p>
                    </Link>
                  </div>
                </Card>
              ))}
            </div>
          </div>
        </>
      )}
    </>
  );
}
